ERROR - 2020-11-19 17:33:06 --> Query error: ERROR:  value too long for type character varying(255) - Invalid query: INSERT INTO "tugas_akhir" ("no_reg", "mahasiswa", "judul_skripsi", "abstrak", "dp_satu", "dp_dua") VALUES ('25616829', '15030052', 'SISTEM PENDUKUNG KEPUTUSAN PENENTUAN GUEST STAR PADA E-MARKETPLACE BERBASIS WEB MENGGUNAKAN METODE WEIGHTED PRODUCT Muhammad Ali Sofyan 15030049 INTISARI E-marketplace didefinisikan sebagai sebuah tempat jual beli barang dan jasa secara online yang dikelola oleh satu pihak yaitu developer, kemudian produk yang ada di dalamnya disediakan oleh pihak lain yaitu penjual. Dalam sebuah event biasanya ada bintang tamu (guest star) yang diminta penyelenggara acara untuk tampil sebagai pengisi acara disebuah event. Para penyelenggara event sering kali kesulitan dalam mencari guest star yang sesuai dengan kebutuhan untuk acaranya, di sisi lain para pengisi event seperti musisi, penari dan lain sebagainya juga kesulitan dalam mempromosikan jasanya. Metode weighted product dapat diterapkan untuk aplikasi sistem pendukung keputusan penentuan guest star pada e-marketplace berbasis web. Tujuan dari tugas akhir ini adalah untuk memberikan alternatif keputusan pemilihan guest star yang sesuai kriteria dengan menggunakan metode weighted product dan menciptakan sebuah pasar online untuk mendapatkan guest star yang sesuai dengan yang diharapkan. Terdapat tiga kriteria yang digunakan untuk menentukan guest star pada e-marketplace ini, yaitu jenis pertunjukan, harga dan lokasi. Sedangkan untuk alternatif yang diujikan sebanyak sembilan alternatif yang terdiri dari guest star yang ada di wilayah DIY. Hasil dari uji fungsionalitas berdasarkan pengujian black box menggunakan browser chrome, mozilla, opera dan Microsoft edge menyatakan bahwa semua fungsi validasi dan button yang ada pada e-marketplace dapat berjalan sesuai dengan fungsinya. Pengujian hasil implementasi sudah sesuai dengan perhitungan weighted product, yaitu guest star yang mempunyai hasil tertinggi dari keseluruhan adalah Frengki Sermadi dengan nilai 0,135234, sedangkan guest star yang mempunyai hasil terendah dari keseluruhan adalah Sanggar Titik Dua dengan nilai 0,083222. Kata Kunci: Sistem Pendukung Keputusan, Weighted Product, E-marketplace, Guest star, Website', 'PENENTUAN PRIORITAS PENGELUARAN KEBUTUHAN NON RUTIN MENGGUNAKAN METODE MULTI-ATTRIBUTIVE BORDER APPROXIMATION AREA COMPARISON (MABAC) DI MASJID AN-NUUR PANDEYAN
', '10209011', '10301028')
